import { Component } from '@angular/core';

@Component({
  selector: 'app-affiche',
  templateUrl: './affiche.component.html',
  styleUrls: ['./affiche.component.css']
})
export class AfficheComponent {


  cv = {
    name: 'Mohamed',
    lastname: 'Bouhlel',
    age: 26,
    job: 'Développeur web',
    email: 'jhgkjhkjbgj',
    tel: 12345678,
    image: 'assets/img/1.jpg',
    hobbies: ['sport', 'voyage', 'lecture'],
    firstname: 'Mohamed',
    path: 'assets/img/1.jpg',
  }






  constructor() { }

  ngOnInit(): void {
  }


}
<div class="card" style="width: 18rem;">
  <img class="card-img-top" src="#" alt="Card image cap">
  <div class="card-body">
    <h5 class="card-title">{{cv.name}}</h5>
    <p class="card-text">{{cv.firstname}}</p>
    <p class="card-text">{{cv.age}}</p>
    <p class="card-text">{{cv.job}}</p>
    <p class="card-text">{{cv.path}}</p>
  </div>
</div>
